It's possible to send transactions with iota.rs, but we strongly recommend to use official wallet.rs library together with stronghold.rs enclave for value-based transfers. This combination incorporates the best security practices while dealing with seeds, related addresses and UTXO. See more information on wallet docs . git clone https://github.com/iotaledger/iota.rs cd iota.rs Rename the .env.example file to .env. Run the examples like: cargo run --example 01_get_info --release // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 01_get_info --release use iota_client::Client; /// In this example we will get information about the node #[tokio::main]
async fn main() { // Create a client instance let iota = Client::builder() .with_node("https://api.lb-0.testnet.chrysalis2.com") // Insert your node URL here // Node with optional authentication // .with_node_auth( // "https://somechrysalisiotanode.com", // Some("Some JWT"), // Some(("name", "password")), // ) .unwrap() .finish() .await .unwrap(); let info = iota.get_info().await.unwrap(); println!("Node Info: {:?}", info);
} // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 02_generate_seed --release use iota_client::crypto::signatures::ed25519::SecretKey; /// In this example we will generate a seed #[tokio::main]
async fn main() { let secret_key = SecretKey::generate().unwrap(); println!("{}", hex::encode(&secret_key.to_le_bytes()));
} // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 03_generate_addresses --release use iota_client::{api::GetAddressesBuilder, Client, Seed};
extern crate dotenv;
use dotenv::dotenv;
use std::env; /// In this example we will create addresses from a seed defined in .env #[tokio::main]
async fn main() { // Create a client instance let iota = Client::builder() .with_node("https://api.lb-0.testnet.chrysalis2.com") // Insert your node URL here .unwrap() .finish() .await .unwrap(); // This example uses dotenv, which is not safe for use in production dotenv().ok(); let seed = Seed::from_bytes(&hex::decode(env::var("NONSECURE_USE_OF_DEVELOPMENT_SEED_1").unwrap()).unwrap()); // Generate addresses with default account index and range let addresses = iota.get_addresses(&seed).finish().await.unwrap(); println!("List of generated public addresses:\n{:?}\n", addresses); // Generate addresses with custom account index and range let addresses = iota .get_addresses(&seed) .with_account_index(0) .with_range(0..4) .finish() .await .unwrap(); println!("List of generated public addresses:\n{:?}\n", addresses); // Generate public (false) & internal (true) addresses let addresses = iota.get_addresses(&seed).with_range(0..4).get_all().await.unwrap(); println!("List of generated public and internal addresses:\n{:?}\n", addresses); // Generate public addresses offline with the bech32_hrp defined let addresses = GetAddressesBuilder::new(&seed) .with_bech32_hrp("atoi".into()) .with_account_index(0) .with_range(0..4) .finish() .await .unwrap(); println!("List of offline generated public addresses:\n{:?}\n", addresses);
