// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 04_get_balance --release use iota_client::{Client, Seed};
extern crate dotenv;
use dotenv::dotenv;
use std::env; /// In this example we will get the account balance of a known seed and the balance and outputs of a known address #[tokio::main]
