async fn main() -> Result<()> { let iota = Client::builder() .with_node("https://api.lb-0.testnet.chrysalis2.com")? .finish() .await?; let message = iota.message().finish().await?; let metadata = iota.get_message().metadata(&message.id().0).await?; println!("Message metadata: {:?}", metadata); Ok(())
} // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 08_data_message --release use iota_client::{Client, Result}; /// In this example we will send a message without a payload #[tokio::main]
