} // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 09_transaction --release use iota_client::{Client, Result, Seed};
extern crate dotenv;
use dotenv::dotenv;
use std::env; /// In this example we will send a transaction #[tokio::main]
async fn main() -> Result<()> { let iota = Client::builder() .with_node("https://api.lb-0.testnet.chrysalis2.com")? .finish() .await?; // This example uses dotenv, which is not safe for use in production // Configure your own seed in ".env". Since the output amount cannot be zero, the seed must contain non-zero balance dotenv().ok(); let seed_1 = Seed::from_bytes(&hex::decode(env::var("NONSECURE_USE_OF_DEVELOPMENT_SEED_1").unwrap())?); let message = iota .message() .with_seed(&seed_1) // Insert the output address and amount to spent. The amount cannot be zero. .with_output( // We generate an address from our seed so that we send the funds to ourselves &iota.get_addresses(&seed_1).with_range(0..1).finish().await?[0], 1_000_000, )? .finish() .await?; println!( "Transaction sent: https://explorer.iota.org/testnet/message/{}", message.id().0 ); Ok(())
} // Copyright 2021 IOTA Stiftung
// SPDX-License-Identifier: Apache-2.0 //! cargo run --example 10_mqtt --release use iota_client::{bee_message::Message, Client, MqttEvent, Result, Topic};
use std::sync::{mpsc::channel, Arc, Mutex}; // Connecting to a MQTT broker using raw ip doesn't work. This is a limitation of rustls.
#[tokio::main]
async fn main() -> Result<()> { // Create a client instance let mut iota = Client::builder() .with_node("https://api.hornet-0.testnet.chrysalis2.com")? .finish() .await?; let (tx, rx) = channel(); let tx = Arc::new(Mutex::new(tx)); let mut event_rx = iota.mqtt_event_receiver(); tokio::spawn(async move { while event_rx.changed().await.is_ok() { let event = event_rx.borrow(); if *event == MqttEvent::Disconnected { println!("mqtt disconnected"); std::process::exit(1); } } }); iota.subscriber() .with_topics(vec![ Topic::new("milestones/latest").unwrap(), Topic::new("messages").unwrap(), ]) .subscribe(move |event| { match event.topic.as_str() { "messages" => { let message: Message = serde_json::from_str(&event.payload).unwrap(); println!("{:?}", event); println!("{:?}", message); } _ => println!("{:?}", event), } tx.lock().unwrap().send(()).unwrap(); }) .await .unwrap(); for _ in 0..10 { rx.recv().unwrap(); } iota.subscriber().disconnect().await.unwrap(); // alternatively // iota.subscriber().unsubscribe().unwrap(); Ok(())
} You can find more advanced examples in the examples folder.

