All features of iota.rs library are accessible via an instance of Client class that provides high-level abstraction to all interactions over IOTA network (Tangle). This class has to be instantiated before starting any interactions with the library, or more precisely with IOTA nodes that power IOTA network. In nodejs binding, the Client instance is instantiated and optionally configured via chaining calls of ClientBuilder helper class. The library is designed to automatically choose a starting IOTA node based on the network type one would like to participate in: testnet or mainnet. So very simplistic example how to connect to IOTA testnet is the following one: function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder() .localPow(true) .build(); client.getInfo().then(console.log).catch(console.error);
} run() Output example of getInfo() function of the ClientBuilder instance: { "nodeinfo":{ "name":"HORNET", "version":"0.6.0-alpha", "isHealthy":true, "networkId":"migration", "bech32HRP":"atoi", "minPoWScore":100, "messagesPerSecond":4.2, "referencedMessagesPerSecond":4.1, "referencedRate":97.61904761904762, "latestMilestoneTimestamp":1618139001, "latestMilestoneIndex":7092, "confirmedMilestoneIndex":7092, "pruningIndex":0, "features":[ "PoW" ] }, "url":"https://api.lb-0.testnet.chrysalis2.com"
} The most important properties: isHealthy: indicates whether the given node is in sync with the network and so it is safe to use it. Even if a node is up and running it may not be fully prepared to process your API calls properly. The node should be "synced", meaning should be aware of all TXs in the Tangle. It is better to avoid not fully synced nodes bech32HRP: indicates whether the given node is a part of testnet (atoi) or mainnet (iota). See more info regarding IOTA address format Please note, when using node load balancers then mentioned health check may be quite useless since follow-up API calls may be served by different node behind the load balancer that may have not been actually checked. One should be aware of this fact and trust the given load balancer participates only with nodes that are in healthy state. iota.rs library additionally supports a management of internal node pool and so load-balancer-like behavior can be mimicked using this feature locally. Needless to say, the ClientBuilder helper class provides several chaining calls via which the process can be closely managed. The most common ones: .network(str): can be testnet or mainnet. It instructs the library whether to automatically select testnet nodes or mainnet nodes .node(url): specify address of actual running IOTA node that should be used to communicate with (in format https://node:port), for ex: https://api.lb-0.testnet.chrysalis2.com:443 .nodePoolUrls(urls): library also supports a management of pool of nodes. You can provide a list of nodes and library manages access to them automatically (selecting them based on their sync status) .localPow(bool): .localPow (True) (by default) means a Proof-of-work is done locally and not remotely .disableNodeSync(): when called, it means library also uses nodes that are not in sync with network. This parameter is usually useful if one would like to interact with local test node that is not fully synced. This parameter should not be used in production If .nodePoolUrls(urls) is provided then the library periodically checks in some interval (call .nodeSyncInterval(interval)) whether node is in sync or not. Example of use of additional initialization chaining calls, such as leveraging a custom node: function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder() .node('https://api.lb-0.testnet.chrysalis2.com:443') // custom node .localPow(true) // pow is done locally .disableNodeSync() // even non-synced node is fine - do not use in production .build(); client.getInfo().then(console.log).catch(console.error);
} run()

