Since the IOTA network is permission-less type of network, anybody is able to use it and interact with it. No central authority is required at any stage. So anybody is able to generate own seed and then deterministically generate respective private keys/addresses. Please note, it is highly recommended to NOT use online seed generators at all. The seed is the only key to the given addresses. Anyone who owns the seed owns also all funds related to respective IOTA addresses (all of them). We strongly recommend to use official wallet.rs library together with stronghold.rs enclave for value-based transfers. This combination incorporates the best security practices while dealing with seeds, related addresses and UTXO. See more information on Chrysalis docs . IOTA uses Ed25519 signature scheme and address is usually represented by Bech32 (checksummed base32) format string of 64 characters. A root of Ed25519 signature scheme is basically a 32-byte (256-bit) uniformly randomly generated seed based on which all private keys and corresponding addresses are generated. In the examples below, the seed is represented by a string of 64 characters using [0-9a-f] alphabet (32 bytes encoded in hexadecimal). Seed can be for example generated using SHA256 algorithm on some random input generated by cryptographically secure pseudo-random generator, such as crypto.randomBytes(): function run() { const crypto = require('crypto'); const seed = crypto.createHash('sha256').update(crypto.randomBytes(256)).digest('hex'); console.log(seed); const { ClientBuilder } = require('@iota/client'); const client = new ClientBuilder().build(); const mnemonic = client.generateMnemonic(); console.log(mnemonic); const hexEncodedSeed = client.mnemonicToHexSeed(mnemonic); console.log(hexEncodedSeed);
} run() Output example: 39bccf7b88a8017e6a96e6f31e34f138829c574dc6061523e84c5f2e53f5ca36
pass phrase weapon yellow diary scissors gift drive strategy antique scheme make surround aerobic mystery coral hope lock walnut become exclude only glove syrup
eff5c97c96ddab55d6fe78f914508750152eaab1b9692236bc79268895ecfd168e91eedd2489ed6c51fc44156b9a2e6c967e4edcfb649ff33d41581be4627347 In modern wallet implementations, such as our wallet.rs library and firefly wallet , the seed is usually generated from a seed mnemonic (seed phrase), using BIP39 standard , to be better memorized/stored by humans. It is based on randomly generated list of english words and later used to generate the seed. Either way, the seed is a root for all generated private keys and addresses Address/key space Before an actual address generation process, let's quickly focus on BIP32 standard that describes an approach to Hierarchical Deterministic Wallets . The standard was improved by BIP44 lately. These standards define a tree structure as a base for address and key space generation which is represented by a derivation path: m / purpose / coin_type / account / change / address_index m: a master node (seed) purpose: constant which is {44} coin_type: a constant set for each crypto currency. IOTA = 4218, for instance. account: account index. Zero-based increasing int. This level splits the address/key space into independent branches (ex. user identities) which each has own set of addresses/keys change: change index which is {0, 1}, also known as wallet chain. There are two independent chain of addresses/keys. 0 is reserved for public addresses (for coin receival) and 1 is reserved for internal (also known as change) addresses to which transaction change is returned. IOTA is totally fine with address reuse, and so it is, technically speaking, totally valid to return transaction change to the same originating address. So it is up to developers whether to leverage it or not. iota.rs library and its sibling wallet.rs help with either scenario address_index: address index. Zero-based increasing int that indicates an address index As outlined, there is a quite large address/key space that is secured by a single unique seed. And there are few additional interesting notes: Each level defines a completely different subtree (subspace) of addresses/keys and those are never mixed up The hierarchy is ready to "absorb" addresses/keys for many different coins at the same time (coin_type), and all those coins are secured by the same seed.(So basically any BIP32/44-compliant wallet is potentially able to manage any BIP32/44-compliant coin(s)) There may be also other purposes in the future however let's consider a single purpose as of now. The constant 44 stands for BIP44 The standard was agreed upon different crypto communities, although not all derivation path components are always in active use. For example, account is not always actively leveraged across crypto space (if this is a case then there is usually account=0 used) Using different accounts may be useful to split addresses/key into some independent spaces and it is up to developers to implement. Please note, it may have a negative impact on a performance while account discovery phase. So if you are after using many multiple accounts then you may be interested in our stateful library wallet.rs that incorporates all business logic needed to efficiently manage independent accounts. Also our exchange guide provides some useful tips how different accounts may be leveraged address_generation So in case of IOTA, the derivation path of address/key space is [seed]/44/4218/{int}/{0,1}/{int}. The levels purpose and coin_type are given, the rest levels are up to developers to integrate. Generating address(es) IOTA addresses are generated via AddressGetter helper class by calling Client.getAddresses() function and respective chaining calls that returns a list of tuples with generated addresses. Considering the previous chapter about individual address/key spaces, it becomes quite clear what all used input function arguments are for. Please note: for the examples outlined below, an example seed b3d7092195c36d47133ff786d4b0a1ef2ee6a0052f6e87b6dc337935c70c531e was used via environment variable called IOTA_SEED_SECRET. This seed serves for training purposes only. The whole process is deterministic which means the output is the same as long as the seed is the same: async function run() { const { ClientBuilder } = require('@iota/client'); // Get the seed from environment variable const IOTA_SEED_SECRET = process.env.IOTA_SEED_SECRET; // client will connect to testnet by default const client = new ClientBuilder().build(); const addresses = await client.getAddresses(IOTA_SEED_SECRET) .accountIndex(0) .range(0, 5) .get(); console.log(addresses);
} run() Output example: ['atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86', 'atoi1qzfvkkp398v7hhvu89fu88hxctf7snwc9sf3a3nd7msfv77jk7qk2ah07s3', 'atoi1qq4t98j5y8wxkaujue99mjwqcp6jvvmsd5lv0755sz7dtjdz3p2lydv76sy', 'atoi1qrhzhjxc4z8vpwjt3hafs5xpdng5katqe890p0h95mc0l273j8yzxn7r4hc', 'atoi1qputu0yvfvxd7g39wf4rc67e0f0dyhl6enxu9jxnsrjqmemh067tw7qelyc', 'atoi1qptg5w2x47qwjf3gpqt3h7d2ey5x7xf8v7qtt29gkxt4mjfjfc28sutvd8a', 'atoi1qprvelq9paakh72fgm6j2kf8kexadw3t5xljer9dpsep5c7wx5mjwdxch6z', 'atoi1qrwk37tz47ddng9kpxfflkpz5tplcq7ll56v4acam04307xk70l7uf6wg8j', 'atoi1qper3zr5xe9x0wqs35ytwh622870g44frkyygdhs0ds8yejle3xujhq7dx3', 'atoi1qq6lkr9hucfylqjaqphu0stvk8pcmsx98r7ukuq40asszwmqytlnc058thk', 'atoi1qzpn7se3ryhscmqg404pycxzvfpt8v4xn8aul0tqdh00xsncgnxu7na7zjj', 'atoi1qz4qqakty9qytw8fk9shelt9lwlvv83s5ggt3wjag9fkgcc74z78w4l86y5', 'atoi1qp20uddchglqry0l5qnjg5aln8d5rk2v5l45hwrxv9z0daxs7u6xcsh4077', 'atoi1qrlqm2u5txxxnjx22fxq0jfjzk6l4nwnue6ht5pepk65m2f4xmxqynmxu2m', 'atoi1qqydc70mpjdvl8l2wyseaseqwzhmedzzxrn4l9g2c8wdcsmhldz0ulwjxpz', 'atoi1qrkjennxyl2xcqem6x69ya65sasma33z0ux872k846lqft0s3qf7k6lqpft', 'atoi1qr4yuekp30ff7mnnnjwy9tdhynxmlmkpuxf70qurtwudp2zpf3jeyw4uh37', 'atoi1qp6m5sz5ayjtccfxapdk5lp4qkheyfg0emzntmulyxzftps730vcul8dmqr', 'atoi1qzrwhkzhu67fqltfffwljejawdcghedukpgu9x6tzevwlnq89gmfjtayhgz', 'atoi1qpehxcp24z947dgupjqc9ktkn5ylmdxqqnx83m7xlajnf8005756u4n7z77'] IOTA address is represented by a checksumed base 32 string (Bech32) and you can see a detailed explanation on Chrysalis docs . Just a recap: If an address starts with atoi then it means it is related to testnet. iota stands for mainnet Number 1 at 5th position is just a separator The last 6 characters are reserved for a checksum Address can be also represented in a hex format and luckily iota.rs provides some convenience functions to convert addresses respectively: Client.bech32ToHex(bech32) and Client.hexToBech32(hex, bech32_hrp (optional)). To quickly validate any IOTA address, there is a convenience function Client.isAddressValid() that returns bool value. Needless to say, performing a sanity check of an address before its use is an advisable practice.

