In Chrysalis testnet, there is a faucet service that provides test tokens to any testnet address: https://faucet.testnet.chrysalis2.com/ There are three common api calls that can be leveraged: Client.getAddressBalance(str): it expects a single address in Bech32 format and returns dict with a balance for the address Client.getAddressBalances([]): a convenience function that expects list of addresses in Bech32 format and returns list of dict with balances for all given addresses Client.getBalance(seed): a convenience helper BalanceGetter class that combines Client.getAddresses() and Client.getAddressBalance() api calls. It returns a combined balance for the provided seed and optional chaining calls .accountIndex(index), .initialAddressIndex(index) and .gapLimit(amount) async function run() { const { ClientBuilder } = require('@iota/client'); // Get the seed from environment variable const IOTA_SEED_SECRET = process.env.IOTA_SEED_SECRET; // client will connect to testnet by default const client = new ClientBuilder().build(); // Get the balance of a single known address console.log( await client.getAddressBalance("atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86") ); // Get the balance of addresses from an account const balance = await client.getBalance(IOTA_SEED_SECRET) .accountIndex(0) .initialAddressIndex(0) .get(); console.log("Account balance: " + balance);
} run() Example of output: { "address":"atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86", "balance":10000000, "dustAllowed":false
}
Account balance: 0 dustAllowed indicates whether the given address is allowed to accepts a dust due to dust protection mechanism Client.getBalance(seed) performs a several tasks under the hood. It starts generating addresses for the provided seed and .accountIndex from .initialAddressIndex(index), and checks for a balance of each of the generated addresses. Since it does not know how many addresses are used in fact, there is a condition set by .gapLimit(amount) argument when to stop searching. If .gapLimit amount of addresses in a row have no balance the function returns result and searching does not continue.

