There are three functions to get UTXO outputs (related to the given address): Client.getAddressOutputs(str): it expects address in Bech32 format and returns str[] of output_ids Client.getOutput(str): it expects output_id and returns the UTXO output metadata associated with it Client.findOutputs(output_ids (optional), addresses (optional)): it is a bit more general and it searches for UTXO outputs associated with the given output_ids and/or addresses async function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder().build(); const outputs = await client.getAddressOutputs('atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86'); console.log(outputs);
} run() Output example: [ '0f2d5d2651f8061a9f5417d0658009f32b2e3f77f9706b0be3b4b3f466171f360000', '7614ba900a90b130707766a660a454942ac7cc4adea3fb9ad0cdca90114417c20000', '768c20c15a290e02a43b83263a98501b9d7eb0b57da40a9247289c672de63ea60000'
