As mentioned above, the message is encapsulating data structure that is being actually broadcasted across network. It is an atomic unit that is accepted/rejected as a whole. There is a function Client.postMessage(message) that accepts message instance and sends it over a network. Alternatively, there is also convenience MessageSender helper class with respective chaining calls that prepares a message instance and broadcasts it over network. The simplest message that can be broadcasted is a message without any particular payload: async function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder().build(); const messageId = await client.message().submit(); console.log(messageId);
} run() Output example: e2daa4c6b012b615becd6c12189b2c9e701ba0d53b31a15425b21af5105fc086 message_id is an unique id that refers to the given message in network Once a message is broadcasted, there is MessageFinder helper class instantiated via Client.getMessage() function that provides helper functions related to the given message, such as Client.getMessage().data(str) and Client.getMessage().metadata(str): async function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder().build(); const tips = await client.getTips(); const message_data = await client.getMessage().data(tips[0]); const message_metadata = await client.getMessage().metadata(tips[0]); console.log(message_metadata); console.log(message_data);
} run() Output example: Message meta data:
{ "messageId": "656f753d781a4c4f545ac6a69e391ec400b7f33ac8bed98add70f7310de910b6", "parentMessageIds": [ "28359f7010ec08b1ed67465f495424f9046ec3890164dddc0240a275f20cecdb", "93b142fdf1bdfe1c5fa68d807287480aa14f2347f601fb349a3f89127b7a9e53", "cf192d94f2af091b1094e7b6513ff6752fcf477dd919b16c8ab823944a78aee7", "dbca8d2119b00fd5ef130bdb900592cafde56142e81c279b80cf18dcaae86f44" ], "isSolid": true, "referencedByMilestoneIndex": 224175, "ledgerInclusionState": "noTransaction"
} Message data:
{ "message": { "networkId": "14379272398717628000", "parentMessageIds": [ "28359f7010ec08b1ed67465f495424f9046ec3890164dddc0240a275f20cecdb", "93b142fdf1bdfe1c5fa68d807287480aa14f2347f601fb349a3f89127b7a9e53", "cf192d94f2af091b1094e7b6513ff6752fcf477dd919b16c8ab823944a78aee7", "dbca8d2119b00fd5ef130bdb900592cafde56142e81c279b80cf18dcaae86f44" ], "payload": { "type": 2, "index": "494f54412e52532042494e44494e47202d204e4f44452e4a53", "data": "736f6d65207574662062617365642064617461" }, "nonce": 9223372036855090000 }, "messageId": "656f753d781a4c4f545ac6a69e391ec400b7f33ac8bed98add70f7310de910b6"
} Client.getMessage().metadata() provides information how the given message fits to network structures such as ledger_inclusion_state, etc. Client.getMessage().data() provides all data that relates to the given message and its payload(s) IndexationPayload IndexationPayload is a payload type that can be used to attach an arbitrary data and key index to a message. At least index should be provided in order to send the given payload. Data part (as bytes[]) is optional one: async function run() { const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder().build(); const message = await client.message() .index('IOTA.RS BINDING - NODE.JS') .data('some utf based data') .submit(); console.log(message);
} run() Output example: 8d4fa37be3c00691131c2c3e03e7b8b956c9118a2ce4be3a8597d51d82ed2de9 Feel free to check the given message using its message_id via Tangle explorer There are three payloads prepared (transaction, milestone and indexation) however only indexation payload is leveraged this time data contains an arbitrary data encoded in bytes Please note there is no IOTA address involved while sending data messages. Such messages are referenced using message_id or key index IOTA addresses are part of UTXO data structure that is sent using SignedTransaction payload explained below SignedTransaction SignedTransaction is a payload type that is used to transfer value-based messages as UTXO (Unspent Transaction Output). As mentioned above, this core payload changes the ledger state as old outputs are being spent (replaced) and new outputs are being created: async function run(){ const { ClientBuilder } = require('@iota/client'); // client will connect to testnet by default const client = new ClientBuilder().build(); const message_data = await client.getMessage().data("e2daa4c6b012b615becd6c12189b2c9e701ba0d53b31a15425b21af5105fc086"); console.log(message_data);
} run() Example of a message with SignedTransaction payload: { "message":{ "networkId":"14379272398717627559", "parentMessageIds":[ "108e58d210b3b918d75fe2c4d7a5248878e29454cfb071688393ec9d1f9ad81b", "90d8d2722bc661aa893a7fa7bb044f7dcdd8503da7e10f5c907649897f110c44", "ac4a389ee6985b9238dbc5882a0a27e3a8b6cf5960d176e64c6f832bdadbe7c6", "c20dc0da13802f9c1e34c269fe19fa96a92c184e5776ed211bfa74ebe33d82a8" ], "payload":{ "type":0, "essence":{ "type":0, "inputs":[ { "type":0, "transactionId":"7614ba900a90b130707766a660a454942ac7cc4adea3fb9ad0cdca90114417c2", "transactionOutputIndex":0 } ], "outputs":[ { "type":0, "address":{ "type":0, "address":"08dc79fb0c9acf9fea71219ec32070afbcb44230e75f950ac1dcdc4377fb44fe" }, "amount":1000000 } ], "payload":null }, "unlockBlocks":[ { "type":0, "signature":{ "type":0, "publicKey":"2baaf3bca8ace9f862e60184bd3e79df25ff230f7eaaa4c7f03daa9833ba854a", "signature":"a0354502ef69dbbfdadb4248791a271ac59c2707b55f3c758de9f5762278a2800553cfec278a4b270c501bbfd5cfcdf8613eda5879d9088835d328228f789d08" } } ] }, "nonce":"17293822569102755792" }, "messageId":"0cd0a0362217a3fec8c03c22fa7135cef96e808f0e2f4a40d3be67c639b17b85"
} Each transaction includes the following set of information: inputs: list of valid outputs that should be used to fund the given message. Those outputs will be spent and once the message is confirmed, those outputs are not valid anymore. Outputs are uniquely referenced via transaction_id and inner index. At least one output has to be given with enough balance to source all outputs of the given message outputs: list of IOTA address(es) and related amount(s) the input outputs should be split among. Based on this information, new UTXO entities (outputs) are being created unlock_blocks: it includes a transaction signature(s) (currently based on Ed25519 scheme) that proofs token ownership based on a valid seed. Needless to say, only valid seed owner is able to correctly sign the given transaction and proofs the ownership of tokens under the given output(s). Each input output has to have a corresponding unblockBlocks entry in case more outputs are used to fund the operation either using the given signature or as a reference to existing signature payload: each SignedTransaction(payload type 0) can include additional payload(s) such as IndexationPayload (payload type 1), etc. Meaning, any value-based messages can also contain arbitrary data and its key index. It is also an example how individual payloads can be encapsulated on different levels of concern Sending value-based messages is also very straightforward process via MessageSender helper class. As a minimum, it needs a valid seed, output addresses and amount. The method finds valid output(s) that can be used to fund the given amount(s) and the unspent amount is sent to the same address: async function run() { const { ClientBuilder } = require('@iota/client'); // Get the seed from environment variable const IOTA_SEED_SECRET = process.env.IOTA_SEED_SECRET; // client will connect to testnet by default const client = new ClientBuilder().build(); const message = await client.message() .seed(IOTA_SEED_SECRET) .output('atoi1qqydc70mpjdvl8l2wyseaseqwzhmedzzxrn4l9g2c8wdcsmhldz0ulwjxpz', 1000000) .submit(); console.log(message);
} run() We recommend to use official wallet.rs library together with stronghold.rs enclave for value-based transfers. This combination incorporates the best security practices while dealing with seeds, related addresses and UTXO. See more information on Chrysalis docs . Dust protection Please note, there is also implemented a dust protection mechanism in the network protocol to avoid malicious actors to spam network in order to decrease node performance while keeping track of unspent amount (UTXO): "... microtransaction below 1Mi of IOTA tokens [can be sent] to another address if there is already at least 1Mi on that address" That's why we did send 1Mi in the given example to comply with the protection."

