In IOTA testnet, there is a faucet service that provides test tokens to any testnet address: https://faucet.testnet.chrysalis2.com/ There are three common api calls that can be leveraged: Client.get_address_balance(address: str): it expects a single address in Bech32 format and returns dict with a balance for the address Client.get_address_balances(list[str]): a convenience function that expects list of addresses in Bech32 format and returns list of dict with balances for all given addresses Client.get_balance(seed, account_index (optional), initial_address_index(optional), gap_limit(optional)): a convenience function that combines Client.get_addresses() and Client.get_address_balances() api calls. It returns a combined balance for the provided seed and its wallet account index import os
import iota_client # Get the seed from environment variable
IOTA_SEED_SECRET = os.getenv('IOTA_SEED_SECRET')
if not IOTA_SEED_SECRET: raise Exception("Please define environment variable called `IOTA_SEED_SECRET`") client = iota_client.Client() print("Return a balance for a single address:")
print( client.get_address_balance("atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86")
) print("Return a balance for the given seed and account_index:")
print( client.get_balance( seed=IOTA_SEED_SECRET, account_index=0, initial_address_index=0 )
) Example of output: Return balance for a single address:
{ "address_type": 0, "address":"atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86", "balance":9000000, "dust_allowed":false
} Return balance for the given seed and account_index:
21000000 address_type indicates type of address. Value 0 denotes a Ed25519 address (currently the default for IOTA) dust_allowed indicates whether the given address is allowed to accepts a dust due to dust protection mechanism Client.get_balance() performs a several tasks under the hood. It starts generating addresses for the provided seed and account_index from initial_address_index, and checks for a balance of each of the generated addresses. Since it does not know how many addresses are used in fact, there is a condition set by gap_limit argument when to stop searching. If gap_limit amount of addresses in a row have no balance the function returns result and searching does not continue.

