} Feel free to check the given message using its message_id via Tangle explorer In comparison to an empty message sent in the previous chapter, the payload section looks more interesting There are three payloads prepared (transaction, milestone and indexation) however only indexation payload is leveraged this time index was simply encoded to list[bytes] in hex (no hash algorithm) and the resulting string can be leveraged as an additional way how to search for a set of indexed messages with the same key index via Tangle explorer or Client.find_messages() API call data contains an arbitrary data encoded in bytes Please note there is no IOTA address involved while sending data messages. Such messages are referenced using message_id or key index IOTA addresses are part of UTXO data structure that is sent using SignedTransaction payload explained below SignedTransaction SignedTransaction is a payload type that is used to transfer value-based messages as UTXO (Unspent Transaction Output). As mentioned above, this core payload changes the ledger state as old outputs are being spent (replaced) and new outputs are being created: import iota_client
client = iota_client.Client() client.get_message_data("f51fb2839e0a24d5b4a97f1f5721fdac0f1eeafd77645968927f7c2f4b46565b") Example of a message with SignedTransaction payload: { "message_id":"f51fb2839e0a24d5b4a97f1f5721fdac0f1eeafd77645968927f7c2f4b46565b", "network_id":7712883261355838377, "parents":[ "4a84bf1d345a441cfdefd0e71d6efe820c1077e5dda9122a09cbf026132d208c", "6e9153884fd1983be4c27c3ccdc69760b4775484eea498ec0707c2ff8901995e", "7ac1407c88007a54d603400b558d5110f2bbf93a68100fb34f0b40cece9d0868", "9ac0fd457998a1b3ddab9c0014f41344475358ad36c64a4b763de3b51f47c09a" ], "payload":{ "transaction":[ { "essence":{ "inputs":[ { "transaction_id":"4a34274992474d91cf45366425ad1d4df6042cba64f3b6c07d297a2e6b7154a9", "index":0 } ], "outputs":[ { "address":"atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86", "amount":10000000 }, { "address":"atoi1qzdnav0zdgd4grn25cnwcuudtahvlhgh0r349ur749y9l03vadrfurhkxwj", "amount":100016136757200 } ], "payload":{ "transaction":"None", "milestone":"None", "indexation":[ { "index":"54414e474c454b495420464155434554", "data":[ ] } ], "receipt":"None", "treasury_transaction":"None" } }, "unlock_blocks":[ { "signature":{ "public_key":[ ... ], "signature":[ ... ] }, "reference":"None" } ] } ], "milestone":"None", "indexation":"None", "receipt":"None", "treasury_transaction":"None" }, "nonce":1146102
} Each transaction includes the following set of information: inputs: list of valid outputs that should be used to fund the given message. Those outputs will be spent and once the message is confirmed, those outputs are not valid anymore. Outputs are uniquely referenced via transaction_id and inner index. At least one output has to be given with enough balance to source all outputs of the given message outputs: list of IOTA address(es) and related amount(s) the input outputs should be split among. Based on this information, new UTXO entities (outputs) are being created unlock_blocks: it includes a transaction signature(s) (currently based on Ed25519 scheme) that proofs token ownership based on a valid seed. Needless to say, only valid seed owner is able to correctly sign the given transaction and proofs the ownership of tokens under the given output(s). Each input output has to have a corresponding unblock_block entry in case more outputs are used to fund the operation either using the given signature or as a reference to existing signature payload: each SignedTransaction can include additional payload(s) such as IndexationPayload, etc. Meaning, any value-based messages can also contain arbitrary data and its key index. It is also an example how individual payloads can be encapsulated on different levels of concern Sending value-based messages is also very straightforward process. As a minimum, it needs a valid seed, output addresses and amount. The method finds valid output(s) that can be used to fund the given amount(s) and the unspent amount is sent to the same address: import os
import iota_client # Get the seed from environment variable
IOTA_SEED_SECRET = os.getenv('IOTA_SEED_SECRET')
if not IOTA_SEED_SECRET: raise Exception("Please define environment variable called `IOTA_SEED_SECRET`") client = iota_client.Client() message = client.message( seed=IOTA_SEED_SECRET, outputs=[ { 'address': 'atoi1qqydc70mpjdvl8l2wyseaseqwzhmedzzxrn4l9g2c8wdcsmhldz0ulwjxpz', 'amount': 1_000_000 } ]
)
print(message) Output example: { "message_id":"7c47db1c4555348c260d91e90cc10fd66c2e73a84ec24bf9533e440f6d945d42", "network_id":7712883261355838377, "parents":[ "0ec0cd3c0303845980981bf7cc72371a8cd6e38c15924a2950fb15c5ecf4a53b", "4011f7724f96b6e39cdf9987ee650c0552d4fc63c09dd72b9be30a3cc7b53806", "5730d5bd607c6125130df30204c995db5edcbd16c4ab150946dffac37ace26f9", "8c1982682dbfa0abdd8772e38d044dbfcbea5ebb99bbe7174c07d81adda62419" ], "payload":{ "transaction":[ { "essence":{ "inputs":[ { "transaction_id":"a22cba0667c922cbb1f8bdcaf970b2a881ccd6e88e2fcce50374de2aac7c3772", "index":0 } ], "outputs":[ { "address":"atoi1qqydc70mpjdvl8l2wyseaseqwzhmedzzxrn4l9g2c8wdcsmhldz0ulwjxpz", "amount":1000000 }, { "address":"atoi1qp9427varyc05py79ajku89xarfgkj74tpel5egr9y7xu3wpfc4lkpx0l86", "amount":9000000 } ], "payload":"None" }, "unlock_blocks":[ { "signature":{ "public_key":[ "..." ], "signature":[ "..." ] }, "reference":"None" } ] } ], "milestone":"None", "indexation":"None", "receipt":"None", "treasury_transaction":"None" }, "nonce":9223372036854802939
} We recommend to use official wallet.rs library together with stronghold.rs enclave for value-based transfers. This combination incorporates the best security practices while dealing with seeds, related addresses and UTXO. See more information on Chrysalis docs . Dust protection Please note, there is also implemented a dust protection mechanism in the network protocol to avoid malicious actors to spam network in order to decrease node performance while keeping track of unspent amount (UTXO): "... microtransaction below 1Mi of IOTA tokens [can be sent] to another address if there is already at least 1Mi on that address" That's why we did send 1Mi in the given example to comply with the protection."

