ng [parents] list[str] undefined The message ids of the parents Returns the built Message . get_message_metadata(message_id): MessageMetadataResponse Param Type Default Description [message_id] str undefined The message id Returns the MessageMetadataResponse . get_message_data(message_id): Message Gets the message data from the message id. Param Type Default Description [message_id] str undefined The message id Returns the Message . get_message_raw(message_id): str Gets the raw message string from the message id. Param Type Default Description [message_id] str undefined The message id Returns the raw message string. get_message_children(message_id): list[str] Gets the children of the given message. Param Type Default Description [message_id] str undefined The message id Returns the list of children strings. get_message_id(payload_str): str Get the message id from the payload string. Param Type Default Description payload_str str undefined The payload string from the mqtt message event Returns The identifier of message. get_message_index(index): list[str] Gets the list of message indices from the message_id. Param Type Default Description [index] str undefined The identifier of message Returns the list of message ids. find_messages(indexation_keys (optional), message_ids (optional)): list[Message] Finds all messages associated with the given indexation keys and message ids. Param Type Default Description [indexation_keys] list[str] undefined The list of indexations keys too search [message_ids] list[str] undefined The list of message ids to search Returns the list of the found messages. get_unspent_address(seed, account_index (optional), initial_address_index(optional)): (str, int) Gets a valid unspent address. Param Type Default Description [seed] str undefined The hex-encoded seed to search [account_index] int undefined The account index [initial_address_index] int undefined The initial address index Returns a tuple with type of (str, int) as the address and corres