When a Client instance (The instance which is used for calling the client APIs) is built, the status of each node listed is checked. If the returned status of the node information is healthy, which means the node is synced, then this node will be pushed into a synced_nodes list. The rust-like pseudo code of synced_nodes construction process follows. The process of syncing a node is repeated every 60 seconds or at the interval specified in the node_sync_interval argument of the initializer if set. synced_nodes = Vec::new()
for node in node_pool_urls{ status = Client.get_info(node).await?; if status == healthy{ synced_nodes.push(node) }
}

